import{_ as t,E as o,Z as n,$ as p,a0 as i,a1 as a,a3 as g,a5 as l}from"./framework-1fb77053.js";const r={},m=i("h2",{id:"_1-简介",tabindex:"-1"},[i("a",{class:"header-anchor",href:"#_1-简介","aria-hidden":"true"},"#"),a(" 1. 简介")],-1),h=i("p",null,"众所周知，GitHub 服务器在国外，使用 GitHub 作为项目托管网站，如果网速不好的话，严重影响使用体验，甚至会出现登录不上的情况。针对这个情况，大家也可以使用国内的项目托管网站-码云。",-1),c={href:"https://gitee.com/",target:"_blank",rel:"noopener noreferrer"},d=i("h2",{id:"_2-码云账号注册和登录",tabindex:"-1"},[i("a",{class:"header-anchor",href:"#_2-码云账号注册和登录","aria-hidden":"true"},"#"),a(" 2. 码云账号注册和登录")],-1),f={href:"https://gitee.com",target:"_blank",rel:"noopener noreferrer"},s=l('<figure><img src="http://img.hl1015.top/blog/image-20211114231622668.png" alt="image-20211114231622668" tabindex="0" loading="lazy"><figcaption>image-20211114231622668</figcaption></figure><p>注册成功登录以后如下图</p><figure><img src="http://img.hl1015.top/blog/image-20211114232013299.png" alt="image-20211114232013299" tabindex="0" loading="lazy"><figcaption>image-20211114232013299</figcaption></figure><h2 id="_3-码云创建远程库" tabindex="-1"><a class="header-anchor" href="#_3-码云创建远程库" aria-hidden="true">#</a> 3. 码云创建远程库</h2><p>点击首页右上角的加号，选择下面的新建仓库</p><figure><img src="http://img.hl1015.top/blog/image-20211114232144227.png" alt="image-20211114232144227" tabindex="0" loading="lazy"><figcaption>image-20211114232144227</figcaption></figure><p>填写仓库名称，路径和选择是否开源（公开库或私有库）</p><img src="http://img.hl1015.top/blog/image-20211114232348715.png" alt="image-20211114232348715" style="zoom:67%;"><p>最后根据需求选择分支模型，然后点击创建按钮</p><figure><img src="http://img.hl1015.top/blog/image-20211114232541334.png" alt="image-20211114232541334" tabindex="0" loading="lazy"><figcaption>image-20211114232541334</figcaption></figure><p>远程库创建好以后，就可以看到 HTTPS 和 SSH 的链接</p><figure><img src="http://img.hl1015.top/blog/image-20211114233012404.png" alt="image-20211114233012404" tabindex="0" loading="lazy"><figcaption>image-20211114233012404</figcaption></figure><h2 id="_4-idea-集成码云" tabindex="-1"><a class="header-anchor" href="#_4-idea-集成码云" aria-hidden="true">#</a> 4. IDEA 集成码云</h2><h3 id="_4-1-idea-安装码云插件" tabindex="-1"><a class="header-anchor" href="#_4-1-idea-安装码云插件" aria-hidden="true">#</a> 4.1 IDEA 安装码云插件</h3><p>IDEA 默认不自带码云插件，我们第一步要安装 Gitee 插件</p><figure><img src="http://img.hl1015.top/blog/image-20211114233322499.png" alt="image-20211114233322499" tabindex="0" loading="lazy"><figcaption>image-20211114233322499</figcaption></figure><p>安装成功并重启 IDEA 后，在 Version Control 设置里面可以看到 Gitee，说明码云插件安装成功</p><figure><img src="http://img.hl1015.top/blog/image-20211114233509867.png" alt="image-20211114233509867" tabindex="0" loading="lazy"><figcaption>image-20211114233509867</figcaption></figure><p>然后在码云插件里面添加码云账号，我们就可以使用 IDEA 连接码云了</p><img src="http://img.hl1015.top/blog/image-20211114233747072.png" alt="image-20211114233747072" style="zoom:67%;"><h3 id="_4-2-idea-连接码云" tabindex="-1"><a class="header-anchor" href="#_4-2-idea-连接码云" aria-hidden="true">#</a> 4.2 IDEA 连接码云</h3><p>IDEA 连接码云和连接 GitHub 几乎一样，首先在 IDEA 里面创建一个工程，初始化 git 工程，然后将代码添加到暂存区，提交到本地库，这些步骤上面已经讲过，此处不再赘述。</p><p><strong>将本地代码 push 到码云远程库</strong></p><figure><img src="http://img.hl1015.top/blog/image-20211114234853411.png" alt="image-20211114234853411" tabindex="0" loading="lazy"><figcaption>image-20211114234853411</figcaption></figure><p>自定义远程库链接</p><img src="http://img.hl1015.top/blog/image-20211115085206298.png" alt="image-20211115085206298" style="zoom:67%;"><p>给远程库链接定义个 name，然后在 URL 里面填入码云远程库的 HTTPS 链接即可。码云云服务器在国内，用 HTTPS 链接即可，没必要用 SSH 免密链接。</p><figure><img src="http://img.hl1015.top/blog/image-20211115085340818.png" alt="image-20211115085340818" tabindex="0" loading="lazy"><figcaption>image-20211115085340818</figcaption></figure><p>然后选择定义好的远程库链接，点击 Push 即可</p><img src="http://img.hl1015.top/blog/image-20211115085618426.png" alt="image-20211115085618426" style="zoom:67%;"><p>看到提示就说明 Push 远程库成功</p><figure><img src="http://img.hl1015.top/blog/image-20211115085744730.png" alt="image-20211115085744730" tabindex="0" loading="lazy"><figcaption>image-20211115085744730</figcaption></figure><p>去码云远程库查看代码</p><figure><img src="http://img.hl1015.top/blog/image-20211115090124883.png" alt="image-20211115090124883" tabindex="0" loading="lazy"><figcaption>image-20211115090124883</figcaption></figure><p>只要码云远程库链接定义好以后，对码云远程库进行 pull 和 clone 的操作和 GitHub 一致，此处不再赘述</p><h2 id="_5-码云复制-github-项目" tabindex="-1"><a class="header-anchor" href="#_5-码云复制-github-项目" aria-hidden="true">#</a> 5. 码云复制 GitHub 项目</h2><p>码云提供了直接复制 GitHub 项目的功能，方便我们做项目的迁移和下载</p><p>具体操作如下：</p><figure><img src="http://img.hl1015.top/blog/image-20211115090600555.png" alt="image-20211115090600555" tabindex="0" loading="lazy"><figcaption>image-20211115090600555</figcaption></figure><figure><img src="http://img.hl1015.top/blog/image-20211115090842490.png" alt="image-20211115090842490" tabindex="0" loading="lazy"><figcaption>image-20211115090842490</figcaption></figure><figure><img src="http://img.hl1015.top/blog/image-20211115091000479.png" alt="image-20211115091000479" tabindex="0" loading="lazy"><figcaption>image-20211115091000479</figcaption></figure><p>如果 GitHub 项目更新了以后，在码云项目端可以手动重新同步，进行更新！</p><figure><img src="http://img.hl1015.top/blog/image-20211115091136180.png" alt="image-20211115091136180" tabindex="0" loading="lazy"><figcaption>image-20211115091136180</figcaption></figure>',43);function u(b,_){const e=o("ExternalLinkIcon");return n(),p("div",null,[m,h,i("p",null,[a("码云是开源中国推出的基于 Git 的代码托管服务中心，网址是 "),i("a",c,[a("https://gitee.com/"),g(e)]),a("，使用方式跟 GitHub 一样，而且它还是一个中文网站，如果你英文不是很好它是最好的选择。")]),d,i("p",null,[a("进入码云官网地址："),i("a",f,[a("https://gitee.com"),g(e)]),a("，点击注册 Gitee")]),s])}const y=t(r,[["render",u],["__file","git-9.html.vue"]]);export{y as default};
